import React from 'react';
import { useEffect, useState, useRef } from "react";
import {
  Dialog,
  DialogActions,
  DialogContent,
  DialogContentText,
  Button,
  DialogTitle
} from "@material-ui/core";
import "./index.scss";

const langLogosArray = {
"Android studio": <i class="fab fa-android"></i> ,
"React" :<i class="fab fa-react"></i>,
"React&Wordpress":<div>  <i class="fab fa-react"></i>  React & <i class="fab fa-wordpress"></i>Wordpress Handles</div>
}

const langLogosTitels = {
    "Android studio":'Android studio' ,
    "React" :'React',
    "React&Wordpress":''
    }

export default function DialogProject({showModal,handleRestart,content}) {


  return (
    <Dialog
    open={showModal}
    disableBackdropClick
    disableEscapeKeyDown
    aria-labelledby="alert-dialog-title"
    aria-describedby="alert-dialog-description"
  >
    <DialogTitle id="alert-dialog-title">
      Hurray!!! You completed the challenge
    </DialogTitle>
    <DialogContent>
      <DialogContentText id="alert-dialog-description">
        You completed the game in {moves} moves. Your best score is{" "}
        {bestScore} moves.
      </DialogContentText>
    </DialogContent>
    <DialogActions>
      <Button onClick={handleRestart} color="primary">
        Restart
      </Button>
    </DialogActions>
  </Dialog>
  );
}
